import React from 'react';
import logo from './logo.png'; // Update the path to match your logo file
import searchIcon from './search-icon.png'; // Update the path to match your search icon file

const Header = () => {
  return (
    <header>
      <div className="logo">
        <img src={logo} alt="Logo" />
        <h1>Your App Name</h1>
      </div>
      <div className="search-bar">
        <input type="text" placeholder="Search..." />
        <img src={searchIcon} alt="Search" className="search-icon" />
      </div>
      <nav>
        {/* Navigation links go here */}
      </nav>
    </header>
  );
};

export default Header;
